input = """"""



def reduce(input, units):
    changes_made = True
    while changes_made:
        changes_made = False
        for c in units:
            for duo in [c+c.upper(), c.upper()+c]:
                if duo in input:
                    changes_made = True
                    input = input.replace(duo, "")
    return input


units = set()
for c in input:
    units.add(c.lower())

shortest_len = None
for c in units:
    s = input.replace(c, "").replace(c.upper(), "")
    l = len(reduce(s, units))
    print("removing", c, "allowed reduction to", l)
    if shortest_len is None or l < shortest_len:
        shortest_len = l

print(shortest_len)




